import DefaultLayout from './layouts/DefaultLayout';
import PayrollFinder from './components/PayrollFinder/PayrollFinder';
const routes = [
  {
    path: '/',
    element: DefaultLayout,
    children: [
      {
        path: '/PayrollFinder',
        element: PayrollFinder,
      },
    ],
  },
];

export default routes;
